    mapping(uint => Reward) public rewards;
    mapping(address => uint256) private _balances;

    struct Reward{
        uint id;
        uint tokenReward;
        address payable author;
    }

    event  UserRewarded(
        uint id,
        string content,
        uint tokenReward,
        address payable author
